import { Text } from '@chakra-ui/react';
import { ReactElement } from 'react';

import type { Training as TrainingType } from '../../../../shared/types';
import { Card } from '../common/Card';

interface TrainingProps {
  treatmentData: TrainingType;
}
export function Training({ treatmentData }: TrainingProps): ReactElement {
  const cardContents = <Text>{treatmentData.description}</Text>;

  return (
    <Card
      itemName={treatmentData.name}
      image={treatmentData.image}
      cardContents={cardContents}
    />
  );
}
